import React from 'react'

export default function Sneaker(props) {

    const {brand, size, price, url, model, source_site, img} = props

    return (
        <div className='sneaker'>
            <img 
                src={require(`${img}`)}
                alt={props.model}
            />
            <h3>{props. model}</h3>
            <img 
                src={`../assets/images/logos/${source_site}`}
                alt={props.source_site}
            />
        </div>
    )
}
